export class ModalNavigator{currentValue=0;elementsToDisplay=[];constructor(e,t){this.currentValue=e,this.elementsToDisplay=t}goToNextIndex(){this.currentValue<this.elementsToDisplay.length-1&&this.currentValue>=0?this.currentValue++:this.currentValue===this.elementsToDisplay.length-1&&(this.currentValue=0)}goToPreviousIndex(){this.currentValue>=1?this.currentValue--:0===this.currentValue&&(this.currentValue=this.elementsToDisplay.length-1)}}